// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
library SafeMath {
    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        uint256 c = a + b;
        require(c >= a, "SafeMath: addition overflow");
        return c;
    }
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b <= a, "SafeMath: subtraction overflow"); 
        uint256 c = a - b;
        return c;
    }
    function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        if (a == 0) {
            return 0;
        }
        uint256 c = a * b;
        require(c / a == b, "SafeMath: multiplication overflow");
        return c;
    }
    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b > 0, "SafeMath: division by zero");
        uint256 c = a / b;
        return c;
    }
    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        require(b != 0, "SafeMath: modulo by zero");
        return a % b;
    }
}
library Address {
    function isContract(address account) internal view returns (bool) {
        uint256 size;
        assembly { size := extcodesize(account) }
        return size > 0;
    }
}
library Counters {
    using SafeMath for uint256;
    struct Counter {
        uint256 _value; 
    }
    function current(Counter storage counter) internal view returns (uint256) {
        return counter._value;
    }
    function increment(Counter storage counter) internal {
        counter._value += 1;
    }
    function decrement(Counter storage counter) internal {
        counter._value = counter._value.sub(1);
    }
}

contract FF7NFT {
	using SafeMath for uint256;
    using Address for address;
    using Counters for Counters.Counter;

	event Transfer(address indexed from, address indexed to, uint256 indexed tokenId);
    event Approval(address indexed owner, address indexed approved, uint256 indexed tokenId);
    event ApprovalForAll(address indexed owner, address indexed operator, bool approved);

    mapping(address => Counters.Counter) private _ownedTokensCount;
    mapping(address => mapping (address => bool)) private _operatorApprovals;
    mapping(address => uint256[]) private _ownedTokens;
    mapping(uint256 => address) private _tokenOwner;
    mapping(uint256 => address) private _tokenApprovals;
    mapping(uint256 => uint256) private _ownedTokensIndex;
    mapping(uint256 => uint256) private _allTokensIndex;
    mapping(uint256 => string) private _tokenURIs;
    mapping(bytes4 => bool) private _supportedInterfaces;

    string private _name = 'Final Fantasy 7';
    string private _symbol = 'FF7NFT';
    uint256[] private _allTokens;

	constructor () {}
	function name() external view returns (string memory) {return _name;}
    function symbol() external view returns (string memory) {return _symbol;}
    function tokenURI(uint256 tokenId) external view returns (string memory) {}
	function balanceOf(address owner) public view returns (uint256 balance) {}
    function ownerOf(uint256 tokenId) public view returns (address owner) {}
    function safeTransferFrom(address from, address to, uint256 tokenId) public {}
    function transferFrom(address from, address to, uint256 tokenId) public {}
    function approve(address to, uint256 tokenId) public {}
    function getApproved(uint256 tokenId) public view returns (address operator) {}
    function setApprovalForAll(address operator, bool _approved) public {}
    function isApprovedForAll(address owner, address operator) public view returns (bool) {}
    function safeTransferFrom(address from, address to, uint256 tokenId, bytes memory data) public {}
    function onERC721Received(address operator, address from, uint256 tokenId, bytes memory data) public returns (bytes4) {}
    function totalSupply() public view returns (uint256) {}
    function tokenOfOwnerByIndex(address owner, uint256 index) public view returns (uint256 tokenId) {}
    function tokenByIndex(uint256 index) public view returns (uint256) {}

    function supportsInterface(bytes4 interfaceId) external view returns (bool) {return _supportedInterfaces[interfaceId];}
    function _registerInterface(bytes4 interfaceId) internal {require(interfaceId != 0xffffffff, "ERC165: invalid interface id");_supportedInterfaces[interfaceId] = true;}
}
